                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
                <Grid item xs={3}>
                    <GroupCard/>
                </Grid>
            </Grid>
            <PopupFab 
            style={{
                position:"absolute",
                bottom:30,
                right:20,
            }}
            title='New Group'
            >
                <CreateGroupPanel/>
            </PopupFab>
        </Box>
    )
}

export default TeamSelectionPage;
